export class Competitor{constructor(e,t,i,s,a,r,m,n,o,c,h,_=0){this._id=e,this._name=t,this.easy=i,this.hard=s,this.tematicas_1=a,this.tematicas_2=r,this.random_score=m,this.min1=n,this.min2=o,this.deluxe=c,this.replica=h,this.counter=_}get id(){return this._id}get name(){return this._name}get_sum(e){try{if("_name"===e||"_id"===e)throw new Error("mode can't be equal to 'name' nor 'id'")}catch(e){console.error(e)}let t=0;try{this[e].forEach(e=>{9!==e&&(t+=e)})}catch(e){t=0}return t}get_total(){return this.get_sum("easy")+this.get_sum("hard")+this.get_sum("tematicas_1")+this.get_sum("tematicas_2")+this.get_sum("random_score")+this.get_sum("min1")+this.get_sum("min2")+this.get_sum("deluxe")}serialize(){return JSON.stringify({id:this._id,name:this._name,easy:this.easy,hard:this.hard,tematicas_1:this.tematicas_1,tematicas_2:this.tematicas_2,random_score:this.random_score,min1:this.min1,min2:this.min2,deluxe:this.deluxe,replica:this.replica,counter:this.counter})}static unserialize(e){const t=JSON.parse(e);return new Competitor(t.id,t.name,t.easy,t.hard,t.tematicas_1,t.tematicas_2,t.random_score,t.min1,t.min2,t.deluxe,t.replica,t.counter)}}export const modes_to_int={easy:0,hard:1,tematicas_1:2,tematicas_2:3,random_score:4,min1:5,min2:6,deluxe:7,end:8,replica:9,end_replica:10};export const modes_aliases={easy:"Easy Mode",hard:"Hard Mode",tematicas_1:"Primera Temática",tematicas_2:"Segunda Temática",random_score:"Random Mode",min1:"Primer Minuto",min2:"Segundo Minuto",deluxe:"Deluxe",replica:"Réplica"};export const mode_length={easy:9,hard:9,tematicas_1:7,tematicas_2:7,random_score:11,min1:18,min2:18,deluxe:14,replica:9};